useEffect(() => {
  const fetchData = async () => {
    try {
      console.log('Fetching data...');
      const response = await fetch('http://localhost:5001/get_words', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(mock_data)
      });
      const data = await response.json();
      console.log('Data received:', data);
      setData(data);
    } catch (error) {
      console.error('Error:', error);
      setError(error);
    } finally {
      setLoading(false); // Make sure setLoading(false) is called in both success and error cases
    }
  };

  fetchData();
}, []);
